export default function getListStudentIds(objectarray) {
  const arrayOfIds = [];
  if (!Array.isArray(objectarray)) {
    return arrayOfIds;
  }
  const value = objectarray.map((x) => {
    return arrayOfIds.push(x.id);
  });
  console.log(value);
  return arrayOfIds;
}
